@import url('https://fonts.googleapis.com/css2?family=Great+Vibes&display=swap');
@import url('https://fonts.googleapis.com/css2?family=Josefin+Sans:wght@200;300;400;500;600;700&display=swap');

$primary-color: #c49b63;
$primary-light-color:#f8b500;
$primary-dark-color:#674c27;

$secondary-color:#fff;
$secondary-light-color:#bfbfbf;
$secondary-dark-color:gray;

$first-additional-color:#151111;

$primary-text-color:#000;
$secondary-text-color:#1d150b;

$primary-font-family:"Josefin Sans", Arial, sans-serif;
$secondary-font-family:"Great Vibes", cursive;

$primary-font-weight:400;
:root
{
    --primary-color: #c49b63;
    --primary-light-color:#f8b500;
    --primary-dark-color:#674c27;

    --secondary-color:#fff;
    --secondary-light-color:#bfbfbf;
    --secondary-dark-color:gray;

    --first-additional-color:#151111;

    --primary-text-color:#000;
    --secondary-text-color:#1d150b;

    --primary-font-family:"Josefin Sans", Arial, sans-serif;
    --secondary-font-family:"Great Vibes", cursive;

    --primary-font-weight:400;
}
*
{
    margin: 0;
    padding: 0;
    box-sizing: border-box;
    -moz-box-sizing: border-box;
    -webkit-box-sizing: border-box;
}
body
{
    overflow-x: hidden;
    background:url(/images/bg_4.jpg.webp) no-repeat fixed top;
    background-size: cover;
    height:100vh;
    z-index: -1;
}
ul
{
    padding-left: 0;
    li
    {
      list-style: none;
    }
}
h1,h2,h3,h4,h5,p
{
    margin-bottom: 0px;
}
button , input , textarea
{
    outline: none;
    background-color: transparent;
    border: none;
}
.row
{
    margin-right: 0;
    margin-left: 0;
}
a
{
    text-decoration: none;
    cursor: pointer;
}

