@import '../Mixins/mixins';
//h1forDiscover and h2 and p for header all sections
.header-text
{
    font: 500 3.125rem/1.5rem $secondary-font-family;
    color: $primary-color;
    padding-top:2rem;
}
.header-down
{
    font: 700 2.5rem $primary-font-family;
    color: $secondary-color;
    text-transform: uppercase;
    margin-bottom: 1.8rem;
}
.header-caption
{
    color: $secondary-dark-color;
    font: 500 1rem/2rem $primary-font-family;
    &.caption2
    {
        width: 60%;
        margin-bottom: 1.5rem;
        @include media('phone')
        {
            width: 98%;
        }
    }
}

// header card and p and span and button
.header-card
{
    font:500 1.125rem/1.4rem $primary-font-family;
    margin-bottom: 1rem;
    color: $secondary-color;
    cursor: pointer;
}
.card-caption
{
    font:500 1rem/1.4rem $primary-font-family;
    margin-bottom: .5rem;
    color: $secondary-dark-color;
    width: 90%;
    text-align: center;
    @include media('phone')
    {
        width: 100%;
    }
}
.card-price
{
    @extend .header-card;
    cursor: text;
}
.card-btn
{
    font:500 1.125rem $primary-font-family;
    border:1px solid $primary-color;
    color: $primary-color;
    padding: .375rem .75rem;
    transition:background-color 300ms ease-in-out;
    &:hover , &:active
    {
        background-color: $primary-color;
        color: $secondary-color;
    }
}

