    {
        background-color: transparent;
        border-bottom: 1px solid rgba($secondary-color,.1);
        z-index: 100;
        padding: 0px;
        height: 92px;
        color: blanchedalmond;
        @include media('tab-port')
        {
            height: auto;
            padding: 1rem 0;
            background-color: $first-additional-color !important;
        }
        @include media('small-phone')
        {
            padding: 1rem;
        }
        &-container
        {
            a
            {
                color: $secondary-color;
            } 
            &-brand
            {
                text-transform: uppercase;
                line-height: 0rem;
                &:hover,&:active,&:focus,&:hover h3 , 
                &:active h3,&:focus h3 ,&:hover span, 
                &:active span,&:focus span
                {
                    color: $secondary-color;
                    border: none;
                    outline: none;
                    box-shadow: 0 0 0 0;
                }
                h3
                {
                    font: 500 1.375rem $primary-font-family;
                }
                span
                {
                    font: 500 .75rem $primary-font-family;
                    letter-spacing: .3rem;
                }
            }
            &-toggler
            {
                border:none;
                background-color: transparent;
                outline: none;
                color: $secondary-color;
                padding: 0;
                @include media('tab-port')
                {
                    display: flex;
                    align-items: center;
                }
                &:focus
                {
                    box-shadow: 0 0 0 0;
                }
                &-icon
                {
                    background-color: $secondary-color;
                    width: 30px;
                    height: 3px;
                    left: 0;
                    border-radius:3px ;
                    display: inline-block;
                    position: relative;
                    &::after,&::before
                    {
                        content: '';
                        @extend .nav-container-toggler-icon;
                        position: absolute;
                    }
                    &::before
                    {
                        top: -10px;
                    }
                    &::after
                    {
                        top: 10px;
                    }
                }
                &-span
                {
                    font: 500 1rem $primary-font-family;
                    margin-left: .5rem;
                }
            }
            &-ul
            {
                height: 92px;
                @include media('tab-port')
                {
                    width: 100vw;
                    height: auto;
                }
                &-items
                {
                    height: 100%;
                    align-items: center;
                    @include media('tab-port')
                    {
                        align-items: flex-start;
                        width: 100%;
                    }
                    &-item
                    {
                        position: relative;
                        height: 100%;
                        display: flex;
                        align-items: center;
                        margin-right: 2.5rem;
                        &:last-of-type
                        {
                            margin-right: 0;
                        }
                        @include media('tab-port')
                        {
                            width: 100%;
                        }
                        a
                        {
                            cursor: pointer;
                            font:400 .8125rem $primary-font-family;
                            text-transform: uppercase;
                            &.active
                            {
                                color: $primary-color !important;
                            }
                        }
                        &-link , i
                        {
                            color: $secondary-color !important;
                            transition: color 300ms ease-in-out;
                        }
                        &:hover a,&:hover i, &:focus i,&:focus a
                        {
                            color: $primary-color !important;
                        }
                    }
                    .Item-Shop
                    {
                        @include media('tab-port')
                        {
                            flex-direction: column;
                            align-items: flex-start;
                        }
                        a
                        {
                            display: flex;
                            align-items: center;
                            i
                            {
                                margin-left: 4px;
                                height: 22px;
                                align-self: flex-start;
                            }
                        }
                        ul
                        {
                            position: absolute;
                            top: 90%;
                            background-color: $first-additional-color;
                            border-top: 12px solid $primary-text-color;
                            border-bottom: 12px solid $primary-text-color;
                            width: 150px;
                            padding: 1rem;
                            opacity: 0;
                            pointer-events: none;
                            transition:opacity .5s ease-in-out;
                            @include media('tab-port')
                            {
                                width: 100%;
                            }
                            li
                            {
                                margin-bottom: .7rem;
                                &:last-of-type
                                {
                                    margin-bottom: 0px;
                                }
                                a
                                {
                                    color: $secondary-dark-color !important;
                                    text-align: start;
                                    font: 400 .8125rem $primary-font-family;
                                    text-transform: capitalize;
                                    transition: color 300ms ease-in-out;
                                }
                                &:hover a, &:focus a
                                {
                                    color: $secondary-color !important;
                                }
                            }
                        }
                        &:hover ul
                        {
                            opacity: 1;
                            pointer-events: visible;
                            @include media('tab-port')
                            {
                                position: relative;
                            }
                        }
                    }
                    .shopping
                    {
                        &-cart
                        {
                            position: relative;
                            @include media('tab-port')
                            {
                                width: 100%;
                            }
                            @include media('tab-port')
                            {
                                display: flex;
                                justify-content: space-between;
                                align-items: center;
                                width: 100%;
                            }
