.main-sec7
{
    &-wrapper
    {
        @extend %flex-wrap;
        div
        {
            width: 100%;
            height: 300px;
            position: relative;
            display: flex;
            justify-content: center;
            align-items: center;
            background-size: cover;
            background-repeat: no-repeat;
            background-position: center;
            @extend %col-3;
            @include media('small-phone')
            {
                width: 100% !important;
            }
            cursor: pointer;
            a
            {
                position: relative;
                width: 50px;
                height: 50px;
                opacity: 0;
                pointer-events: none;
                i
                {
                    color: $secondary-color;
                    transform: rotate(0);
                    z-index: 2;
                }
                &::after
                {
                    @extend %i-after;
                    z-index: 1;
                    opacity: 0;
                    transform: rotate(-90deg);
                    border: none;
                    background-color: $primary-color;
                    transition:transform 300ms ease-in-out,opacity 200ms ease-in-out;
                }
            }
            &:hover a
            {
                opacity: 1;
                pointer-events: visible;
            }
            &:hover a::after
            {
                opacity: 1;
                transform: rotate(45deg);
            }
        }
        .bground-1
        {
            background-image: url(/images/gallery-1.jpg.webp);
        }
        .bground-2
        {
            background-image: url(/images/gallery-2.jpg.webp);
        }
        .bground-3
        {
            background-image: url(/images/gallery-3.jpg.webp);
        }
        .bground-4
        {
            background-image: url(/images/gallery-4.jpg.webp);
        }
    }
}

