.main-sec9
{
    background: url(/images/bg_1.jpg.webp) no-repeat fixed 20% 50%;
    background-size: cover;
    padding-top: 6.9rem;
    &::after
    {
        content: '';
        
    }
    &-wrapper
    {
        align-items: flex-end;
        justify-content: flex-start;
        margin-top: 3rem;
        @extend %flex-wrap;
        &-sec
        {
            width: calc(100% / 5);
            background-color: $primary-color;
            position: relative;
            padding:2rem 1.5rem;
            height: fit-content;
            max-height: fit-content;
            @include media('tab-port')
            {
                width: calc(100% / 1);
            }
            &:nth-of-type(2n)
            {
                &::after
                {
                    content: "";
                    display: inline-block;
                    position: absolute;
                    z-index: -1;
                    top: 0;
                    left: 0;
                    width: 100%;
                    height: 100%;
                    background-color: rgba($primary-text-color, .15);
                }   
            }
            p
            {
                font:400 1rem/1.9rem $primary-font-family;
                color: $secondary-color;
            }
            &-img
            {
                margin-top: 1.5rem;
                align-items:center;
                img
                {
                    width: 40px;
                    height: 40px;
                    margin-right: 1rem;
                }
                h5
                {
                    font:400 1rem $primary-font-family;
                    color: $secondary-color;
                }
                span
                {
                    font:400 .75rem $primary-font-family;
                    color: rgba($secondary-color,.8);
                    text-transform: capitalize;
                    margin-top: .7rem;
                }
            }
        }
    }
}

